const Student = ({ student }) => {

    const { name, lastname, age, email } = student;

    return (
        <div>
            <p>Name: {name}</p>
            <p>Lastname: {lastname}</p>
            <p>Age: {age}</p>
            <p>E-mail: {email}</p>
        </div>
    )
}


export default Student
